import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import TillForm from './TillForm';
import LottoForm from './LottoForm';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Till Form</Link>
            </li>
            <li>
              <Link to="/lotto">Lotto Form</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route exact path="/" component={TillForm} />
          <Route path="/lotto" component={LottoForm} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
